const INITIAL_STATE = {
    usuarios: []
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_usuarios':
            return { ...state, usuarios: action.payload }
        case 'crear_usuario':
            return {
                ...state,
                usuarios: action.payload
            }
        case 'editar_usuario':
            return {
                ...state,
                usuarios: action.payload
            }
        case 'eliminar_usuario':
            return {
                ...state,
                usuarios: action.payload
            }
        default:
            return state;
    }
}
